import React, { Component } from 'react'

export default class quotes extends Component {
  constructor() {
    super()
    this.state = {
      quotes: "not yet gotten"
    }
  }

  render() {
    return (
      <div>
        <button>get quotes</button>
        <h1>{this.state.quotes}</h1>
      </div>
    )
  }
}
